import React, {Component} from "react";
import "../containers/Home.css";
import {Button, Checkbox, FormGroup, FormControlLabel, Typography, Grid, Box, LinearProgress} from '@material-ui/core';

class CheckboxList extends React.Component{
  constructor() {
    this.state = {
      checkedValues: []
    }
  }
  handleCheck(index) {
    this.setState({
        data: ["Kutjes"],
        checkedValues: this.state.checkedValues.concat([index])
    });
  }
  render(){
         return (
         <div key={item}>
            <Checkbox
           value={item}
           onChange={this.handleCheck.bind(this, index)} //Use .bind to pass params to functions
           checked={this.state.checkedValues.some( selected_index => index === selected_index )}
          />
          <label>{item}</label>
         </div>);
  }
}

export default CheckboxList;
